import { View, Text,Image,StyleSheet } from 'react-native'
import React from 'react'
import Icon  from 'react-native-vector-icons/Entypo';

export default function PersonalInformation({name,profilelink,location,rating}) {
  return (
    <View className='bg-white m-3 flex-row rounded-2xl justify-evenly'>
        <View className='flex-1 justify-center ml-4 mt-4'>
            <Text className='text-xl font-bold'>{name}</Text>
            <View className='flex-row'>
            <Icon name="location-pin" size={30} color="#900" />
            <Text className='text-sm'>{location}</Text>
            </View>
            <View className='flex-row'>
            <Icon name="star" size={25} color="#900" />
            <Text className='text-sm mb-2'>{rating}</Text>
            </View>

        </View>
        <View className='justify-right items-center justify-center pr-4'>
            <Image source={{uri:profilelink}} style={styles.imagestyling}/>
        </View>


    </View>
  )
}
const styles = StyleSheet.create({
    imagestyling:{
        width:75,
        height:75,
        borderRadius:20
    }
})
